import cricket from './images/cricket.jpg';
import webD from './images/webD.jpg';
import Guitar from './images/Guitar.jpg';

const Sdata = [
    {
        imgsrc : webD,
        title : 'Web Developer',
        p : ' I AM A MERN stack web developer and very good knowledge of frontend developing using react js.'
    },
    {
        imgsrc : Guitar,
        title : 'Musicolic',
        p : 'I AM A music lover who play guitar and sing as well' 
    },
    {
        imgsrc : cricket,
        title : 'Cricketer',
        p : 'I AM A Bowling All rounder , bowl a spin and hard hitter as well'
    }
]

export default Sdata;
